import React from 'react'

const ListItems = ({ items }) => {
    
    const keys = Object.keys(items[0]);
    console.log(keys);
  return (
    <table>
        {
            keys.map(keyItem => <th key={keyItem}>{keyItem}</th>)
        }
        {
            items.map(item => (
                <tr key={item.id}>
                    {keys.map(keyItem => <td>{item[keyItem]}</td>)}
                </tr>
            ))
        }
    </table>
  )
}

export default ListItems
